import styled from 'styled-components';

export const Background = styled.div`
  height: 100vh;

  display: flex;
  flex-direction: column;
  justify-content: center;
  text-align: center;


`;

export const Title = styled.h1`
  font-family: ${(props) => props.theme.font.font1.med};
`
